</defs>
</svg>
      </a>
    </div>
    <ul class="nav col-12 col-md-auto mb-2 justify-content-center mb-md-0">
      <li><a routerLink="/" routerLinkActive="active" class="nav-link px-2 link-secondary">INICIO</a></li>
      <li><a routerLink="/cont" routerLinkActive="active" class="nav-link px-2">CONTENIDO</a></li>
      <li><a routerLink="/glosario" routerLinkActive="active" class="nav-link px-2">GLOSARIO</a></li>
    </ul>
    <div class="col-md-3 text-end">
      <a routerLink="/login">
      <button type="button" class="btn btn-outline-primary me-2">Cuenta</button>
      </a>
    </div>
  </header>
</div>
